@_SxnnyBoy “Eres el intento de suicida más horrible que he visto nunca...”

...y eso que no había visto muchos. Sus pómulos continuaban ardiendo, y la ninfa, cansada de aquella bochornosa imagen, se revolvió, queriendo erguirse. 

“No es "nuestro amor" si el único enamorado eres tú...pero +
